import { actionTypes } from "../actions/me.action";

const initialState = {
  NAME: '',
  EMAIL: '',
  LOADING: true
}

export default (state = initialState, action) => {
  switch (action.type) {
    
    case 'INDEX_ME':
      return action.payload;

    default:
      return state;
  }
}
